import React from "react";
import { Text, StyleSheet, View, Image } from "react-native";

const ImageDetail = ({ title, image }) => {
  // console.log(image);
  return (
    <View>
      <Image source={require({ image })} />
      <Text>{title}</Text>
    </View>
  );
};

const style = StyleSheet.create({});

export default ImageDetail;
